import React from 'react';
import Button from '@material-ui/core/Button';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Button variant="contained" color="primary">
      Hello World
    </Button>
      </header>

      <nav>
        <p>"Nav bar"</p>
      </nav>


    </div>
  );
}

export default App;
